import {Link} from "react-router-dom";
import {useRef} from "react";

export const FormChild = ({parameters,inputs}) => {
    const email = useRef(null);
    const password = useRef(null);

    function execute() {
        parameters.event(email.current.value, password.current.value)
    }

    return (<div className="row justify-content-center">
            <div className="col-12 col-md-5 col-lg-6 col-xl-4 px-lg-6 my-5 align-self-center">

                <h1 className="display-4 text-center mb-3">
                    {parameters.title}
                </h1>

                <p className="text-muted text-center mb-5">
                    {parameters.subtitle}
                </p>

                <form>

                    <div className="form-group">

                        <label className="form-label">
                            {parameters.email.label}
                        </label>

                        <input ref={email} type={parameters.email.type} className="form-control"
                               placeholder={parameters.email.placeholder}/>
                    </div>

                    <button type={"button"} onClick={execute} className="btn btn-lg w-100 btn-primary mb-3">
                        {parameters.button.value}
                    </button>
                    <div className="text-center">
                        <small className="text-muted text-center">
                            Vous n'avez pas encore de compte ? <Link to={parameters.signupUrl}>S'inscrire</Link>.
                        </small>
                    </div>

                </form>

            </div>
            <div className="col-12 col-md-7 col-lg-6 col-xl-8 d-none d-lg-block">
                <div className="bg-cover h-100 min-vh-100 mt-n1 me-n3"
                     style={{backgroundImage: 'url(assets/img/covers/auction-bg1.jpg)'}}></div>

            </div>
        </div>)
}
